import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

class Profile extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            userInfo: props.userInfo
        };
    }

    render() {
        return (
            <Router>
                <div>
                    {this.state.userInfo.email}
                </div>
            </Router>
        );
    }
}

export default Profile;
